import React from "react";
import HeroSection from "../components/HeroSection"; // Hero banner
import AboutUs from "../components/AboutUs"; // Seção "Bem-vindo à HomeCare"
import Services from "../components/Services"; // Fisioterapia e Consulta Online
import WorkProcess from "../components/WorkProcess"; // How it Works
import Contact from "../components/Contact"; // Contactos
import Header from "../components/Header"; // Cabeçalho
import Footer from "../components/Footer"; // Rodapé

const HomePage = () => {
  return (
    <div>
      <Header />
      <HeroSection />
      <Services />
      <AboutUs />
      <WorkProcess />
      <Contact />
      <Footer />
    </div>
  );
};

export default HomePage;
